import GlobalStyles from "@mui/material/GlobalStyles";
import { createTheme } from "@mui/system";
import { LightSwitch } from "./components/LightSwitch";

const customTheme = createTheme({
  typography: {
    fontFamily: [
      "-apple-system",
      "BlinkMacSystemFont",
      '"Segoe UI"',
      "Roboto",
      '"Helvetica Neue"',
      "Arial",
      "sans-serif",
      '"Apple Color Emoji"',
      '"Segoe UI Emoji"',
      '"Segoe UI Symbol"',
    ].join(","),
  },
  colors: {
    textMain: "#FFFFFF",
  },
});

function App() {
  return (
    <>
      <GlobalStyles
        styles={(customTheme) => ({
          body: {
            fontFamily: customTheme.typography.fontFamily,
          },
        })}
      />
      <h1>IoT Hydroponics Project</h1>
      <LightSwitch />
    </>
  );
}

export default App;
